package JavaSkills;

public class KK_5_Relational_Operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int p=10,q=15;
System.out.println(p==q); //false
System.out.println(p!=q);//true
System.out.println(p<=q);//true
System.out.println(p>=q);//false
System.out.println(p<q);//true
System.out.println(p>q);//false

	}

}
